style.css:
@-moz-document domain("stardom-world.com") {
body {
    color: #e6e6e6!important;
    background: #181818!important;
}



.box-header {
    background-color: #181818!important;
}

.nav-inner + .nav-inner {
    border-top: 1px solid #303030!important;
    box-shadow: 0px 2px 2px 0px #303030!important;
}

.btn-global-nav {
    color: #e6e6e6!important;
}

.box-dropdown-target {
    background: #181818!important;
    box-shadow: 0px 2px 5px #303030!important;
}

.major-category {
    border-bottom: 1px solid #303030!important;
}

.goog-te-gadget-simple {
    background-color: #181818;
    border-left: 1px solid #606060;
    border-top: 1px solid #606060;
    border-bottom: 1px solid #606060;
    border-right: 1px solid #606060;
}

.goog-te-gadget {
    color: #666;
    background: #181818
}

.goog-te-gadget-simple .goog-te-menu-value {
    color: #e6e6e6;
    background: #181818
}

.goog-te-menu2 {
    background-color: #181818;
    border: 1px solid #606060;
}

.goog-te-menu2-item-selected div,
.goog-te-menu2-item-selected:link div {
    color: #e6e6e6!important;
}

.goog-te-menu2-item div,
.goog-te-menu2-item:link div {
    background: #181818;
    color: #e6e6e6;
}

.goog-te-menu2-item:hover div {
    background: #606060;
    color: #e6e6e6;
}

.logo-area a img {
    display: none;
}

.logo-area {
    background: url(https://i.ibb.co/kQjBLxW/Logo.jpg);
    width: 160px;
    height: 46.8px;
}

.goog-te-gadget-icon {
    background-image: url(https://i.ibb.co/wKwK1Mc/googgle.jpg)!important;
    width: 19px;
    height: 19px;
}





.tile-inner {
    background: #3e3e40!important;
    box-shadow: 0px 2px 2px 0px #303030!important;
}

.box-contentsInfo-section + .box-contentsInfo-section {
    border-top: 1px solid #909090!important;
}

.purchase-info-area .btn-toggle {
    border: 1px solid #909090!important;
}

.content-list-item article {
    border: 1px solid #909090!important;
}

.js-list-slide .slick-slide a {
    color: #e6e6e6;
}

.news-list-item h3 a {
    color: #909090;
}

.form-control {
    color: #909090;
    background-color: #303030;
    border: 1px solid #909090;
}

.form-control:focus {
    color: #909090;
    background-color: #303030;
    border: 1px solid #909090;
}

.btn-theme {
    background: #f778a9;
    background-color: rgb(247, 120, 169);
    background-clip: border-box;
    border-color: #f778a9;
}

.tag-content {
    background: #303030;
    color: #909090;
}

.favorite.user-logoff {
    cursor: auto;
    background: #181818;
    color: #cccccc;
    border-color: #909090;
}

.favorite:hover {
    background: #f778a9;
}

.page-item.disabled .page-link {
    color: #6c757d;
    background-color: #303030;
    border-color: #909090;
}

.page-item .page-link {
    background-color: #303030;
    border-color: #909090;
}

.page-item .page-link:hover {
    background: #606060;
}

.page-item.active .page-link {
    background-color: #f778a9;
    border-color: #f778a9;
}

.box-sort .btn {
    border-left: 1px solid #909090;
}

.box-sidemenu .content-list-item {
    border-top: 0px solid #cccccc;
    border-bottom: 0px solid #cccccc;
    margin: -1px;
}

.accordion-box {
    background: #606060;
}

.modal-header {
    border-bottom: 1px solid #606060;
}

.close:not(:disabled):not(.disabled) {
    color: #cccccc
}

.modal-content {
    position: relative;
    display: -webkit-box;
    display: flex;
    -webkit-box-orient: vertical;
    -webkit-box-direction: normal;
    flex-direction: column;
    width: 100%;
    pointer-events: auto;
    background-color: #181818;
    background-clip: padding-box;
    border: 1px solid rgba(0, 0, 0, 0.2);
    border-radius: 0.3rem;
    outline: 0;
}

.card {
    background-color: #606060;
    border: 1px solid rgba(0, 0, 0, 0.125);
}



.box-footer {
    background: #181818!important;
}



.slick-dots li button::before {
    color: #cccccc;
}

.slick-dots li.slick-active button::before {
    opacity: .75;
    color: #cccccc;
}
}
